import styled from 'styled-components';


export const MainContainer = styled.div`
    height: 100vh;
    background-color: #aab6fe;
    border: none;
    margin: none;
`

export const Header = styled.div`
    background-color: #aab6fe 0.5;
    opacity: 0.5;
    height: 12vh;
    display: flex;
    justify-content: flex-start;
    padding: 10px;    
    border: none;
    margin: none;
` 

export const Logo = styled.img`
    width: auto;
    height: 100%;
    cursor: pointer;
    :first-child {
        margin-left:20px;
    }
`

export const Banner = styled.img`
    width: 100%;
    height: 88.9vh;
    border: none;
    margin: none;
`
export const Footer = styled.footer`
    background-color: #6dffe7;
    height: 7vh;
    display: flex;
    justify-content: flex-start;
    border: none;
    margin: none;
`
